@Component({
  selector: 'app-bookmarks',
  templateUrl: './bookmarks.component.html',
  styleUrls: ['./bookmarks.component.scss']
})
export class BookmarksComponent {

}
<div class="bookmark-wrapper">
  <div class="container">
    <div class="bookmark-tile">
